/*
 * Google Web Search - KDE SC 4.4
 *
 * Version     : 1.5.4
 * Author      : Andreas Demmer
 * Updated     : June 21th, 2010
 * Website     : http://www.andreas-demmer.de
 * Description : Modifies the colors and images on Google Web Search (http://www.google.com/), based on the excellent skins by Valacar (http://www.valacar.com/userstyles/)
 * Usage       : Use with the Stylish Firefox extension (http://userstyles.org/) or copy to your Firefox userContent.css file
 */

@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document
  url-prefix(http://www.google),
  url-prefix(http://images.google),
  url-prefix(http://video.google)
{
/* hide full-width doodles */
#body > center > div {
  background: none !important;
}

/* fix buttons with sys style */
.ds {
  border: 0px !important;
}

.lsbb {
  background: transparent !important;
  border: 0px !important;
  padding-left: 10px !important;
}

input.lsb {
  border: 0px !important;
  background: transparent !important;
  margin-left: 10px !important;
}

/* fix input fields with sys style */
input.lst {
  border: 0px !important;
  background: none !important;
  background-color: #fff;
}

/* Replace big logo */
body img[src*="logos/"], 
body img[src$="logo.gif"], 
body div[style*="logo_plain.png"], 
body img[src$="logo_google_suggest.gif"], 
body img[src^="logos/holiday"], 
body img[src^="/img/video_logo_lg.gif"], 
body img[src*="/images/ps_logo_lg.gif"], 
div#lga #logo,
body center div#logo 
{
  margin-top: 6% !important;
  width: 0 !important;
  height: 110px !important;
  padding-left: 281px !important;
  background-color: transparent !important;
  background-repeat: no-repeat;
  background-image: url("data:image/png;base64,") !important;
}

/* hide language info */
div#logo div {
  display: none;
}

/* Replace small logo */
body #tsf img {
  display: none;
}

body #srp-logo img {
  display: none !important;
}

body #srp-logo {
  width: 100px !important;
  color: transparent !important;
  height: 38px !important;
}
body #tsf a#logo,
body #srp-logo,
.ss,
body #header a#logo,
body #sform a#logo > img,
body img[src$="/logo_sm.gif"]
{
  height: 38px !important;
  width: 100px !important;
}

body .csb,
.n div {
  height: 28px !important;
}


body #tsf a#logo,
body #srp-logo,
body .csb,
#nf,
#nc,
.nr,
.ss,
.nf,
body #header a#logo,
body #sform a#logo > img,
body img[src$="/logo_sm.gif"]
{
  background-image: url("data:image/png;base64,") !important;
  background-position: -16px 10px;
}




/* Google bar "menu" and Google Suggest
---------------------------------------*/

#gog {
  background: transparent !important;
}

#gbar > nobr > a, #guser, #guser > nobr > a, #guser > nobr > #gbe > a {
color: #ccc !important;
}

#gbar b {
color: #eee !important;
}



#gbi, #gbg, .gac_m {
  background:#B6D2DE !important;
  border-color: #678F9F !important;
  -moz-box-shadow: 4px 4px 10px rgba(0,0,0, 0.5) !important;
}

a.gb2:hover,
.gac_b .gac_c,
.gac_b .gac_d {
  color: #fff !important;
  background:#8FBBCD !important;
}

.gbd { border-color: #444 !important; }
.gbh { border: none !important; }

.gac_a > .gac_c { color:#333 !important; }


.gac_d, .gac_e { color: rgba(255,255,255,0.5) !important; }

/* ad URL */
.gac_h { color: #ccc !important; }

/* small search on results page */
form > table#sft { 
background: none !important;
width: auto !important;
height: auto !important;
}

form > table#sft > tbody > tr > td {
padding: 0 0 10px 0 !important   ;
}

/* autosuggest */
form > table.gac_m > tbody > tr > td {
padding: 0px !important   ;
}

/* google.* slash firefox */
form > table#frame {
    margin-top: 50px !important;
    background: #fff !important;
    padding: 0px 20px 10px 20px !important;
    -moz-border-radius: 10px;
}

form > table#frame > tbody > tr > td  {
    padding: 0px !important;
}

/* search box widget */
form > table > tbody > tr > td {
padding: 25px 0px 0px 0px !important   ;
}

#srp-header form table,
#foot form table,
table#texttable, /* Google translate */
table#webtable, /* Google translate */
table.mp_dialog { /* Google Mail "change contact picture" layer */
  background: none !important;
}

form > table > tbody > tr > td > font > span {
position: relative;
top: -20px;
}

td.search-box {
	text-align: right;
}

form[name='bgs'] > table {
  background: none !important;
}

.lst-td {
  border-bottom: 0px !important;
}

form > table {
    width: 762px;
    height: 132px;
    margin: 0px auto;
    background: url("data:image/jpg;base64,") no-repeat !important;
}

/* froogle searcb box */
.srchBoxCont, .srchButtonRightShadow, .srchButtonBorder, #srchButton { 
  border: 0px !important;
  background: none !important;
  background-color: transparent !important;
  margin-left: 0px !important;
  margin-right: 0px !important;
}

.srchBoxCont, .srchBoxCont input {
  width: 500px !important;
}


.srchBoxCont input {
  margin-left: 20px !important;
}

.src_box {
  float: none;
}

form[action='/products'] td {
  width: 100px !important;
}

form[action='/products'] .search_advanced {
  padding-right: 20px !important;
}


/* Search results
-----------------*/

.current_mode, .mitem {
  background:#678F9F !important;
  border-color: #678F9F !important;
}

#hmp {
  background: none !important;
  background-color: transparent !important;
}

.mode_desc b {
  color: #fff !important;
}

#result-count {
  top: auto !important;
}

#issferb {
color: #ccc !important;
}

#res .g {
    background: url("data:image/jpg;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAAAXNSR0IArs4c6QAAAAZiS0dEAP8A/wD/oL2nkwAAAAlwSFlzAAALEwAACxMBAJqcGAAAAAd0SU1FB9oECQkZOTwtZjwAAAAZdEVYdENvbW1lbnQAQ3JlYXRlZCB3aXRoIEdJTVBXgQ4XAAAADUlEQVQI12P4//+/GgAJIgMksOYDrwAAAABJRU5ErkJggg==") !important;
padding: 10px !important;
    -moz-border-radius: 10px;
}

/* big link */
#res .g img {
  margin-right:15px !important;
}

/* big link */
#res .g .r a {
  color: #333 !important;
  text-decoration: none !important;
}

/* big link visited */
#res .g h3 a:visited:before {
   position: relative;
   top: 5px;
	padding-right: 5px;
	content: url("data:image/jpg;base64,") !important;
}
#res .g a:visited {
  color: #5b7079 !important;
  position: relative;
  top: -5px;
}

/* link description */
#res .g .s {
  color: #444 !important;
}

/* star */
.ws, .wsa {
background-color: #fff !important;
-moz-border-radius: 10px !important;
}

/* URL text */
.a, cite, .cite, .cite:link {
  color:#444 !important;
}

/* cached and similar links */
#res .g .s .gl a {
  color: #444 !important;
}

/* dashes between Cached and Similar links */
.gl { color: #666 !important; }

/* visited cached and similar links */
#res .g .s .gl a:visited {
  opacity: 1.0 !important;
}

/* sub page links (on first link result) */
#res .s .slk a {
  color: #666 !important;
  opacity: 1.0 !important;
}

/* visited sub page links  */
#res .s .slk a:visited {
  opacity: 1.0 !important;
}

/* larger link title */
#res .l { font-size: 1.1em !important; }

/* more line spacing on descriptions */
#res .s { line-height: 1.4 !important; }

/* image thumbnails */
#res .g img {
  border: none !important;
  -moz-box-shadow: 4px 4px 10px rgba(0,0,0,0.4) !important;
}

/* File type (ex: [PDF]) next to link */
.g .w { color: #666 !important; }

/* "File Format" */
.f { color: #6a848f !important; }


/* "video results" time info */
#res .g .ts font[color="#666666"] {
  color: #666 !important;
}

/* "more options" */
.tbo #tbd {
  background: transparent !important;
  border-color: #666 !important;
}

/* Related searches bar */
#tbt5 {
  background: #B5DEEE !important;
  border-color: rgba(255,255,255,0.1) !important;
  -moz-border-radius: 10px;
}

/* source code listing */
#res tt { color: #333 !important; }


/* Ads
------*/
#mbEnd, #tads { background: rgba(128,128,128,0.2) !important; }

#mbEnd {
  border-left: 1px solid transparent !important;
}

/* hide search result ads (delete next line if you want them) */
#mbEnd, #tads { display: none !important; }

/* Google Suggest ads */
.gac_n { display: none !important; }



/* Bars
-------*/

/* results bar */
#ssb,
#ps-titlebar,
form[action="/movies"] tr[bgcolor="#e5ecf9"],
#canvas > .heading  {
  background:#94BDCE !important;
  border-top-color: #678F9F !important;
border-bottom-color: #678F9F !important;
    -moz-border-radius: 10px;
}

/* big bar after bottom pager */
#bsf,
#navbar + br + table td[bgcolor="#e5ecf9"] {
  
    background: url("data:image/jpg;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAAAXNSR0IArs4c6QAAAAZiS0dEAP8A/wD/oL2nkwAAAAlwSFlzAAALEwAACxMBAJqcGAAAAAd0SU1FB9oECQkZOTwtZjwAAAAZdEVYdENvbW1lbnQAQ3JlYXRlZCB3aXRoIEdJTVBXgQ4XAAAADUlEQVQI12P4//+/GgAJIgMksOYDrwAAAABJRU5ErkJggg==") !important;
  border-top-color: #678F9F !important;
border-bottom-color: #678F9F !important;
}

/* hide borders */
.k { background: none !important; }

/* hide old pager images */
#navbar td img { visibility: hidden !important; }

/* images/video results details-panel */
#center_col {
  border-left: 0px !important;
}

#hidden_modes {
  background: transparent !important;
}

#rpsp, #tbd, .tbt, #lhs-ref, #leftnav {
	background: url("data:image/jpg;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAAAXNSR0IArs4c6QAAAAZiS0dEAP8A/wD/oL2nkwAAAAlwSFlzAAALEwAACxMBAJqcGAAAAAd0SU1FB9oECQkZOTwtZjwAAAAZdEVYdENvbW1lbnQAQ3JlYXRlZCB3aXRoIEdJTVBXgQ4XAAAADUlEQVQI12P4//+/GgAJIgMksOYDrwAAAABJRU5ErkJggg==") !important;
	border-right: 0px !important;
	padding: 5px !important;
	-moz-border-radius-topright: 10px;
	-moz-border-radius-bottomright: 10px;
}

.tbt {
    -moz-border-radius-topleft: 10px;
	-moz-border-radius-bottomleft: 10px;
}

#rphd, #rptgl span, #rpsp a, #rpsp b {
	color: #444 !important;
}

/* fix result page upper search form */
.tsf-p > table {
  border-bottom: 0px !important;
}

/* Replacement images
---------------------*/

/* Hide small logo text link, and intl text name */
a#logo, #lgpd + div > div[style^="color: rgb(102, 102, 102); font-size: 16px"] { font-size: 0 !important; }

}
